this.storeValue(file, 1, "json", cache)

const _this = this;
const DBM = this.getDBM();

checkCommand = function(msg) {
	let command = DBM.Bot.checkTag(msg.content);
	if(command) {
		if(!this._caseSensitive) {
			command = command.toLowerCase();
		}
		const cmd = DBM.Bot.$cmds[command];
		if(cmd) {
			return true;
		}
                return false;
	}
	return;
}

if(checkCommand(msg) == false) {
